import Diary from './Diary';
import './Diaries.css';

const Diaries = () => {
    const [diaries, setDiaries] = useState([{
        title: '',
        content: '',
        selectedHeart: 0, 
        date: null,
        bodyChecked: ''
    }])

    return(
        <Diary diaries={diaries} setDiaries={setDiaries} />
    )

}

export default Diaries;
